select fips,'wood.urban' as type,10,total from urban;

create view feedstock_all as 
select p.fips,p.price,h as hardwood,s as softwood,m as mill,t as thinning,ho as other_h,so as other_softwood,0.5*(coalesce(h,0)+coalesce(s,0)+coalesce(t,0))+coalesce(ho,0)+coalesce(so,0)+coalesce(m,0) as total
from 
(select distinct fips,price from feedstock ) as p
full outer join
(select fips,price,marginal as h from feedstock where type='forest.hardwood') as h 
on (p.fips=h.fips and p.price=h.price)
full outer join 
(select fips,price,marginal as s from feedstock where type='forest.softwood') as s 
on (p.fips=s.fips and p.price=s.price) 
full outer join 
(select fips,price,marginal as t from feedstock where type='forest.thinnings') as t
on (p.fips=t.fips and p.price=t.price) 
full outer join 
(select fips,price,marginal as ho from feedstock where type='forest.other.hardwood') as ho
on (p.fips=ho.fips and p.price=ho.price) 
full outer join 
(select fips,price,marginal as so from feedstock where type='forest.other.softwood') as so
on (p.fips=so.fips and p.price=so.price) 
full outer join 
(select fips,price,marginal as m from feedstock where type='forest.mill') as m
on (p.fips=m.fips and p.price=m.price);



delete from feedstock where marginal=0;

-- Finally create a view of cumulative costs for Mui
create view feedstock_cumulative  as select fips,type,t,sum(marginal) from feedstock f join generate_series(25,200,25) as t on (price<=t) where type='forest' group by fips,type,t;
